import { Navigate } from "react-router-dom"

let withLoginNavigate = (Component) =>
{

    let compWithLoginNavigate = (props) =>
    { 
        if(props.isAuth)
        {
        return(
           <Component />
        )
        }
        else{
             return<Navigate to="/Login" />
            }
    }


   return compWithLoginNavigate
}

export default withLoginNavigate
